import React from "react";
import { Container, Row } from "react-bootstrap";
import BrandCard from "../../Components/Brand/BrandCard";
import SectionTitle from "../../Components/Utilities/SectionTitle";
import Pagenation from "../../Components/Utilities/Pagenation";

const AllBrands = () => {
  // روابط الصور من الإنترنت
  const brandImages = [
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/png;base64,",
    "data:image/jpeg;base64,",
    "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR7MzFZqLC4StWWv4VznJmsB3zsgLHWXdIQHg&s",
  ];
  const allBrands = Array(18)
    .fill()
    .map((_, index) => brandImages[index % brandImages.length]);

  return (
    <div>
      <Container style={{ minHeight: "630px" }} className="mb-2 mt-2">
        <SectionTitle title={"All brands"} pathroute={"/allBrands"} />
        <Row className="d-flex my-1 justify-content-between row-cols-2 row-cols-sm-3 row-cols-md-4 row-cols-lg-5 row-cols-xl-6 g-3">
          {allBrands.map((imgUrl, index) => (
            <BrandCard key={index} img={imgUrl} />
          ))}
        </Row>
      </Container>
      <Pagenation />
    </div>
  );
};

export default AllBrands;
